import React from "react";
import { Circle } from "react-konva";
import Konva from "konva";

class Scatterplot extends React.Component {
  render() {
    return (
      <>
        <Circle
          x={this.props.xPos}
          y={this.props.yPos}
          radius={this.props.radius}
          fill={"red"}
        />
      </>
    );
  }
}

export default Scatterplot;
